import MovieCard from './MovieCard'





function MovieList(props) {





  return (
    <>



            <div className='row justify-content-center'>
                {props.movies.map((item,index)=>{
                    return (
                      <>
                        <MovieCard
                        item={item}
                        key={index}
                        />


                       </> 
                    )



                }
                )}


            </div>

        </>

  )
}

export default MovieList
